package days;

public class Day05 {

    public static void main(String[] args) {
        runA();
        runB();
    }

    public static void runA() {
        String input = getInput();
//        input = "dabAcCaCBAcCcaDA";
        input = poef(input);

        System.out.println("answer A: " + input.length());
    }

    public static String poef(String input) {
        for(int i = input.length()-1; i > 0; i--) {
            if(input.length()-1 < i) {
                continue;
            }
            char current = input.charAt(i);
            char previous = input.charAt(i-1);

            if((Character.toUpperCase(current) == previous || Character.toLowerCase(current) == previous) && previous != current ) { // Aa or aA but not aa or AA
                input = input.substring(0,i-1) + input.substring(i+1);
            }
        }
        return input;
    }


    public static String removeCombi(String input, String combi) {
        return input.replaceAll(combi, "");
    }


    public static void runB() {
        int shortestPolymer = 100000;

        for(char ch = 'a'; ch <= 'z'; ch++ ) {
            System.out.println(ch);
            String input = getInput();
            input = removeCombi(input, String.valueOf(ch));
            input = removeCombi(input, String.valueOf(Character.toUpperCase(ch)));
            int length = poef(input).length();
            if(length < shortestPolymer) {
                shortestPolymer = length;
            }

        }

        System.out.println("answer B: " + shortestPolymer);
    }

    public static String getInput() {
        return "";
    }

}
